import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './html/style.css';
import Home from './Home';
import SelectInput from './SelectInput';
import Text from './Text';
import Voice from './Voice'; 
import Makaton from './Makaton'; 


import React, { useEffect } from 'react';

function App() {
  useEffect(() => {
    const handleScroll = () => {
      const stars = document.getElementById('./html/stars');
      const moon = document.getElementById('./html/moon');
      const mountainsBehind = document.getElementById('./html/mountains_behind');
      const text = document.getElementById('./html/text');
      const btn = document.getElementById('./html/btn');
      const mountainsFront = document.getElementById('./html/mountains_front');
      const header = document.querySelector('./html/header');

      const value = window.scrollY;
      stars.style.left = value * 0.25 + 'px';
      moon.style.top = value * 1.05 + 'px';
      mountainsBehind.style.top = value * 0.5 + 'px';
      mountainsFront.style.top = value * 0 + 'px';
      text.style.marginRight = value * 4 + 'px';
      text.style.marginTop = value * 1.5 + 'px';
      btn.style.marginTop = value * 1.5 + 'px';
      header.style.top = value * 0.5 + 'px';
    };

    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <div>
      <header>
        <div className="logo-wrapper">
          <a href="#" className="logo">
            MAKASTORY
          </a>
          <a href="#" className="subtitle">
            Generating stories for kids
          </a>
        </div>
        <ul>
          <li>
            <a href="../Voice.js">Voice</a>
          </li>
          <li>
            <a href="../Text.js">Text</a>
          </li>
          <li>
            <a href="../Sign.js">Sign</a>
          </li>
          <li>
            <a href="#"> </a>
          </li>
        </ul>
      </header>
      <section>
        <img src="stars.png" id="stars" alt="Stars" />
        <img src="moon.png" id="moon" alt="Moon" />
        <img src="mountains_behind.png" id="mountains_behind" alt="Mountains Behind" />
        <h2 id="text">Start Adventure</h2>
        <a href="#sec" id="btn">
          Explore
        </a>
        <img src="mountains_front.png" id="mountains_front" alt="Mountains Front" />
      </section>
      <div className="sec" id="sec">
        <h2>About CHAS</h2>
        <p>
          {/* Your CHAS content goes here */}
        </p>
      </div>
      <div className="sec2" id="sec2">
        <div className="sec2-content">
          <img src="abbie-comp.png" alt="Abbie" className="chas-image" />
          <div className="chas-story">
            <h2>Core Story from CHAS</h2>
            <p>
              {/* Your CHAS story content goes here */}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
